ATTRIBUTE.VALUE:
delete from SHIPMENT_CANCEL_SUMMARY where  CREATE_USERID <> 'm_MEX_SHIP_CAN_SUMM' AND AS_OF_DATE = ( SELECT (AS_OF_DATE - 7) FROM DAY_DIMENSION d
WHERE DAY_DATE =  TRUNC(SYSDATE) );
Commit;

DELETE FROM SHIPMENT_CANCEL_SUMMARY  WHERE TRUNC(CREATE_DATE) <=  ADD_MONTHS(TRUNC(sysdate),-3) AND CREATE_USERID <> 'm_MEX_SHIP_CAN_SUMM' ;
commit;
